import React, { useState } from 'react';

const PieceDetail = () => {
  const [pieces, setPieces] = useState([]);
  const [formData, setFormData] = useState({
    productDetails: {
      quantity: '',
      unity: '',
      hscode: '',
      productDescription: ''
    },
    parcels: {
      invoiceNumber: '',
      invoiceDate: '',
      grossWeight: '',
      netWeight: ''
    },
    customs: {
      fob: '',
      currency: '',
      valueInCurrency: '',
      exchangeRate: ''
    },
    duties: {
      exportDutyRate: '',
      exportDutyAmount: '',
      cessRate: '',
      cessAmount: ''
    },
    taxInvoice: {
      cth: '',
      invoiceNo: '',
      invoiceDate: '',
      siNo: '',
      value: ''
    },
    gstDetails: {
      lutBondDetails: '',
      igstRate: '',
      igstAmount: '',
      compensationRate: '',
      compensationAmount: ''
    },
    ecommerceParticulars: {
      ecommerce: '',
      url: '',
      paymentTxnId: '',
      skuNo: ''
    }
  });

  const handleInputChange = (section, field, value) => {
    setFormData({
      ...formData,
      [section]: {
        ...formData[section],
        [field]: value
      }
    });
  };

  const handleAddPiece = () => {
    const pieceData = { ...formData };
    setPieces([...pieces, pieceData]);
  };

  return (
    <div>
      <div>
        <h2>Product Details Form</h2>
        <div>
          <label>Quantity:</label>
          <input
            type="text"
            value={formData.productDetails.quantity}
            onChange={(e) => handleInputChange('productDetails', 'quantity', e.target.value)}
          />
        </div>
        <div>
          <label>Unity (Dropdown):</label>
          <select
            value={formData.productDetails.unity}
            onChange={(e) => handleInputChange('productDetails', 'unity', e.target.value)}
          >
            <option value="">Select Unity</option>
            <option value="Grams">Grams</option>
            <option value="KG">KG</option>
            <option value="Litre">Litre</option>
            <option value="Metre">Metre</option>
            <option value="Pieces">Pieces</option>
            <option value="Carat">Carat</option>
          </select>
        </div>
        {/* Add more form fields for Product Details */}
        {/* ... */}
      </div>

      <div>
        <h2>Details of Parcels</h2>
        {/* Add form fields for Parcels */}
        {/* ... */}
      </div>

      <div>
        <h2>Value under Section 14 Customs Act</h2>
        {/* Add form fields for Value under Section 14 Customs Act */}
        {/* ... */}
      </div>

      <div>
        <h2>Customs Duties</h2>
        {/* Add form fields for Customs Duties */}
        {/* ... */}
      </div>

      <div>
        <h2>Tax/Commercial Invoice</h2>
        {/* Add form fields for Tax/Commercial Invoice */}
        {/* ... */}
      </div>

      <div>
        <h2>GST Details</h2>
        {/* Add form fields for GST Details */}
        {/* ... */}
      </div>

      <div>
        <h2>Ecommerce Particulars</h2>
        {/* Add form fields for Ecommerce Particulars */}
        {/* ... */}
      </div>

      <button onClick={handleAddPiece}>ADD PIECE</button>

      <h2>Added Pieces</h2>
      {pieces.map((piece, index) => (
        <div key={index}>
          <pre>{JSON.stringify(piece, null, 2)}</pre>
        </div>
      ))}
    </div>
  );
};

export default PieceDetail;
